import s from "./style.module.css";

const BreadCrumbs: React.FC = () => {
  return (
    <ul className={s.breadcrumbs}>
      <li>Players</li>
      <li>Greg Whittington</li>
    </ul>
  );
};

export default BreadCrumbs;
